import './App.css';
import BlobsBackground from './BlobsBackground';
import MainCardContents from './MainCardContents';
import Card from './Card';

function App() {
	return (
		<div className="App">
			<BlobsBackground />
			<Card width="80%">
				<MainCardContents />
			</Card>
		</div>
	);
}

export default App;
